import React from 'react'
import Book1 from "./OpeningBooks/Book1";
import Book2 from "./OpeningBooks/Book2";
import Book3 from "./OpeningBooks/Book3";
import Book4 from "./OpeningBooks/Book4";
import Book5 from "./OpeningBooks/Book5";
import Book6 from "./OpeningBooks/Book6";
import Book7 from "./OpeningBooks/Book7";
import {  useNavigate } from 'react-router-dom';

const BookShelf = () => {

    const navigate = useNavigate();

    return (
        <div className="h-full">
            <div className="flex">
                <div className="mr-3 cursor-pointer hover:scale-105 ease-in-out duration-300" onClick={ () => navigate(`band/new`)}>
                    <Book1/>
                </div>
                <div className="mr-3 cursor-pointer hover:scale-105 ease-in-out duration-300" onClick={ () => navigate(`giraffe/new`)}>
                    <Book2/>
                </div>
                <div className="mr-3 cursor-pointer hover:scale-105 ease-in-out duration-300" onClick={ () => navigate(`judge/new`)}>
                    <Book3/>
                </div>
                <div className="mr-3 cursor-pointer hover:scale-105 ease-in-out duration-300" onClick={ () => navigate(`magic/new`)}>
                    <Book4/>
                </div>
            </div>
            <div className="flex justify-center mt-">
                <div className="mr-3 cursor-pointer hover:scale-105 ease-in-out duration-300" onClick={ () => navigate(`movie/new`)}>
                    <Book5/>
                </div>
                <div className="mr-3 cursor-pointer hover:scale-105 ease-in-out duration-300" onClick={ () => navigate(`vacation/new`)}>
                    <Book6/>
                </div>
                <div className="cursor-pointer hover:scale-105 ease-in-out duration-300" onClick={ () => navigate(`wonder/new`)}>
                    <Book7/>
                </div>
            </div>
        </div>
    );
};

export default BookShelf;
